import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<App />);


ReactDOM.render(
  <Router>
    <Routes>
      <Route path="/" component={App} />
    </Routes>
  </Router>,
  document.getElementById('root')
);
